import React from "react";
import { NavLink } from "react-router-dom";

function Navbar() {
  return (
    <AppBar position="static">
      <Toolbar>Navbar</Toolbar>

      <NavLink to="/" exact>
        Home
      </NavLink>

      <NavLink to="/doctors" exact>
        Doctors
      </NavLink>

      <NavLink to="/patients" exact>
        Patients
      </NavLink>
    </AppBar>
  );
}

export default Navbar;
